import React, {Router} from 'react'
import {Link} from "react-router-dom"
import {Consumer, withChartContext} from "./DataProvider"


function BlsLink(button) {
    return (
        <Consumer>
            {value => (<Link>to={{
                pathname: `/study/${button.series_id}`,
                state:{button}
            }}><button onClick={value.getDataInfo}>{button.title}</button></Link>)}
         </Consumer>
    )
}

export default withChartContext(BlsLink)
